import axios from "axios";
import Config from '../config/Config';

const ApiRequest = {
  Session: {
    Login: (params) => {
      return async (dispatch) => {
      let res = null;
      try {
        res = await axios.post(`${Config.ApiRequest.request.baseURL + Config.ApiRequest.urls.LOGIN}`, params, {
          headers: Config.ApiRequest.request.headers
        })
        dispatch({
          sd: Config.ApiRequest.actionsTypes.LOGIN,
          data: {
            token: res.data.token
          }
        });
        console.log(res);
      } catch (e) {
        console.log(e);
      } finally {
        console.log(res);
      }
    }
    }
  },
  Peine: {
    Main: () => {
      return async (dispatch) => {
        const params = new URLSearchParams();
        params.append("token", "74698f97674df362f772ebf1339fca75");
        params.append("device", "Web");
        let res = null;
        try {
          res = await axios.post(`${Config.ApiRequest.request.baseURL + Config.ApiRequest.urls.MAIN}`, params, {
            headers: Config.ApiRequest.request.headers
          })
          dispatch({
            type: Config.ApiRequest.actionsTypes.INIT_MAIN,
            data: {
              user: {
                name: res.data.user.name,
                avatar: res.data.user.avatar,
                favs: res.data.user.favs
              },
              contents: res.data.contents
            }
          });

        } catch (e) {
          //console.log(e);
        } finally {
          return res.data.user;
        }
      }
    },
    Player: async (params) => {

    }
  }
}

export default ApiRequest;
